import React, { useState } from "react";
import ReactStoreIndicator from "react-score-indicator";

export const Score = () => {
  const [clicks, setClicks] = useState(20);
  return (
    <ReactStoreIndicator
      value={clicks}
      maxValue={100}
      lineWidth={15}
      lineGap={3}
      fadedOpacity={20}
    />
  );
};
